INSERT INTO `landings` VALUES (1,'complex','https://complex.one-team.pro/',3,'2023-08-27 23:53:04','2023-10-27 06:55:43','8 800 700 55 55','ЖК SKY BLUE','<p>Жилой комплекс класса бизнес на берегу моря в новом районе Алтынташ. Это первый район в Анталии с утвержденным проектом планировки территории</p>','uploads/landing_84724362.jpg','[{\"id\": \"0\", \"title\": \"2024\", \"content\": \"I квартал сдача жилого комплекса\"}, {\"id\": \"1\", \"title\": \"50\", \"content\": \"Всего квартир в комплексе\"}, {\"id\": \"2\", \"title\": \"ВНЖ\", \"content\": \"Вид на жительство при покупке\"}, {\"id\": \"3\", \"title\": \"2\", \"content\": \"Больших бассейна на территории ЖК\"}]',NULL,'PERGE COLLECTION: SKY BLUE','БИЗНЕС-КЛАСС НА БЕРЕГУ СРЕДИЗЕМНОГО МОРЯ','[{\"id\": \"0\", \"photo\": \"uploads/landing_1408793994.png\", \"title\": \"Большая закрытая территория с двумя бассейнами\", \"content\": \"<p>5700м2 - идеальная территория для 50 квартир, чтобы чувствовать уединенность и приватность. На территории есть сауна и тренажерный зал. Разноуровневые посадки растений по всей территории по индивидуальному проекту. Спортивная площадка для баскетбола, волейбола или тенниса.</p>\"}, {\"id\": \"1\", \"photo\": \"uploads/landing_1793062718.png\", \"title\": \"Большая закрытая территория с двумя бассейнами\", \"content\": \"<p>5700м2 - идеальная территория для 50 квартир, чтобы чувствовать уединенность и приватность. На территории есть сауна и тренажерный зал. Разноуровневые посадки растений по всей территории по индивидуальному проекту. Спортивная площадка для баскетбола, волейбола или тенниса.</p>\"}]','[{\"id\": \"0\", \"title\": \"Беспроцентная рассрочка\", \"content\": \"<p>Рассрочка на период строительства</p>\\r\\n<p>Первоначальный платеж 30% от стоимости квартиры</p>\\r\\n<ul class=\\\"list_point\\\">\\r\\n<li>Возможна удалённая сделка</li>\\r\\n<li>Помощь по вариантам оплаты</li>\\r\\n</ul>\\r\\n<p>Вид на жительство можете получить после внесения последнего платежа</p>\"}, {\"id\": \"1\", \"title\": \"Оплата 100%\", \"content\": \"<ul class=\\\"list_point\\\">\\r\\n<li>Возможна удалённая сделка</li>\\r\\n<li>Помощь по вариантам оплаты</li>\\r\\n</ul>\"}]','uploads/landing_406444150.png','ВНЖ','<p>Покупая квартиру в ЖК &laquo;Perge Collection: sky blue&raquo; вы не только приобретаете жилье в большом курортном городе с отличным климатом, которое можно сдавать в аренду, но и получаете более ценные преимущества, такие, как вид на жительство в Турции или даже гражданство.</p>\r\n<p>ВНЖ имеет ряд несомненных плюсов, вы можете круглогодично жить в стране, открыть свой бизнес, бесплатно пользоваться некоторыми государственными услугами, а также претендовать на турецкое гражданство уже через 5 лет после приобретения недвижимости.</p>\r\n<p>Турецкий паспорт позволит вам пользоваться всеми привилегиями этого государства, путешествовать в безвизовом режиме более чем по 110 странам, получить право открыть свое дело в США и Великобритании и многое другое.</p>\r\n<p>Процесс оформления проходит достаточно быстро и просто, а это значит, что, приобретая квартиру в нашем жилищном комплексе, вы инвестируете в свое будущее.</p>','<iframe src=\"https://yandex.ru/map-widget/v1/?um=constructor%3Afc64a3d223ff913723c16022e4266225030f99a540ffe10915e3499fe62a343b&amp;source=constructor&amp;scroll=false\" width=\"100%\" height=\"500\" frameborder=\"0\"></iframe>',NULL,NULL,'PERGE COLLECTION','Анталья, Турция',15,NULL),(7,'country','https://country.one-team.pro/',2,'2023-10-20 10:30:25','2023-10-20 10:30:25','8 800 700 55 55','ТУРЦИЯ','<p>Регион, в котором море, солнце, история и природа соединяются в гармонии. Древние города, море, солнце, пляж, лес - компоненты одного прекрасного целого. Мустафа Кемаль Ататюрк описывает Анталью фразой: &laquo;Несомненно, Анталья - самое красивое место в мире&raquo;.</p>','uploads/landing_459739980.jpg','[{\"id\": \"0\", \"title\": \"310\", \"content\": \"Солнечных дней в году\"}, {\"id\": \"1\", \"title\": \"50\", \"content\": \"Комплексов в продаже\"}, {\"id\": \"2\", \"title\": \"ВНЖ\", \"content\": \"Вид на жительство при покупке\"}, {\"id\": \"3\", \"title\": \"15\", \"content\": \"Инвестиционный процент\"}]','НОВОСТРОЙКИ В ТУРЦИИ',NULL,NULL,NULL,'[{\"id\": \"0\", \"title\": \"Беспроцентная рассрочка\", \"content\": \"<p>Рассрочка на период строительства</p>\\r\\n<p>Первоначальный платеж 30% от стоимости квартиры</p>\\r\\n<ul class=\\\"list_point\\\">\\r\\n<li>Возможна удалённая сделка</li>\\r\\n<li>Помощь по вариантам оплаты</li>\\r\\n</ul>\\r\\n<p>Вид на жительство можете получить после внесения последнего платежа</p>\"}, {\"id\": \"1\", \"title\": \"Оплата 100%\", \"content\": \"<ul class=\\\"list_point\\\"><li>Возможна удалённая сделка</li><li>Помощь по вариантам оплаты</li></ul>\"}]',NULL,'Вид на жительство в Турции','<p>Покупая квартиру в ЖК &laquo;Perge Collection: sky blue&raquo; вы не только приобретаете жилье в большом курортном городе с отличным климатом, которое можно сдавать в аренду, но и получаете более ценные преимущества, такие, как вид на жительство в Турции или даже гражданство.</p>\r\n<p>ВНЖ имеет ряд несомненных плюсов, вы можете круглогодично жить в стране, открыть свой бизнес, бесплатно пользоваться некоторыми государственными услугами, а также претендовать на турецкое гражданство уже через 5 лет после приобретения недвижимости.</p>\r\n<p>Турецкий паспорт позволит вам пользоваться всеми привилегиями этого государства, путешествовать в безвизовом режиме более чем по 110 странам, получить право открыть свое дело в США и Великобритании и многое другое.</p>\r\n<p>Процесс оформления проходит достаточно быстро и просто, а это значит, что, приобретая квартиру в нашем жилищном комплексе, вы инвестируете в свое будущее.</p>','<iframe src=\"https://yandex.ru/map-widget/v1/?um=constructor%3Afc64a3d223ff913723c16022e4266225030f99a540ffe10915e3499fe62a343b&source=constructor&scroll=false\" width=\"100%\" height=\"500\" frameborder=\"0\"></iframe>','ДОСТОПРИЧАТЕЛЬНОСТИ ТУРЦИИ','[{\"id\": \"0\", \"photo\": \"uploads/landing_1531113488.png\", \"title\": \"Десятки исторических памятников культуры\", \"content\": \"<p>Анталья &ndash; курортный город, который славится своей Старой гаванью, где швартуются яхты, и пляжами, окруженными огромными отелями.</p>\"}, {\"id\": \"1\", \"photo\": \"uploads/landing_818982039.png\", \"title\": \"Десятки исторических памятников культуры\", \"content\": \"<p>В Анталье расположены десятки исторических памятников культуры, которые непременно стоит увидеть! На протяжении всей своей истории Анталья становилась домом для десятка цивилизаций, сохранила следы этих цивилизаций и сегодня выставляет их для своих посетителей</p>\"}]',NULL,NULL,17,NULL),(8,'region','https://region.one-team.pro/',1,'2023-10-20 10:37:30','2023-10-20 10:37:30','8 800 700 55 55','АНТАЛИЯ','<p>Регион, в котором море, солнце, история и природа соединяются в гармонии. Древние города, море, солнце, пляж, лес - компоненты одного прекрасного целого. Мустафа Кемаль Ататюрк описывает Анталью фразой: &laquo;Несомненно, Анталья - самое красивое место в мире&raquo;.</p>','uploads/landing_2086620209.jpg','[{\"id\": \"0\", \"title\": \"310\", \"content\": \"Солнечных дней в году\"}, {\"id\": \"1\", \"title\": \"50\", \"content\": \"Комплексов в продаже\"}, {\"id\": \"2\", \"title\": \"ВНЖ\", \"content\": \"Вид на жительство при покупке\"}, {\"id\": \"3\", \"title\": \"15\", \"content\": \"Инвестиционный процент\"}]','НОВОСТРОЙКИ В АНТАЛИИ',NULL,NULL,NULL,'[{\"id\": \"0\", \"title\": \"Беспроцентная рассрочка\", \"content\": \"<p>Рассрочка на период строительства</p>\\r\\n<p>Первоначальный платеж 30% от стоимости квартиры</p>\\r\\n<ul class=\\\"list_point\\\">\\r\\n<li>Возможна удалённая сделка</li>\\r\\n<li>Помощь по вариантам оплаты</li>\\r\\n</ul>\\r\\n<p>Вид на жительство можете получить после внесения последнего платежа</p>\"}, {\"id\": \"1\", \"title\": \"Оплата 100%\", \"content\": \"<ul class=\\\"list_point\\\"><li>Возможна удалённая сделка</li><li>Помощь по вариантам оплаты</li></ul>\"}]',NULL,'Вид на жительство в Анталии','<p>Покупая квартиру в ЖК &laquo;Perge Collection: sky blue&raquo; вы не только приобретаете жилье в большом курортном городе с отличным климатом, которое можно сдавать в аренду, но и получаете более ценные преимущества, такие, как вид на жительство в Турции или даже гражданство.</p>\r\n<p>ВНЖ имеет ряд несомненных плюсов, вы можете круглогодично жить в стране, открыть свой бизнес, бесплатно пользоваться некоторыми государственными услугами, а также претендовать на турецкое гражданство уже через 5 лет после приобретения недвижимости.</p>\r\n<p>Турецкий паспорт позволит вам пользоваться всеми привилегиями этого государства, путешествовать в безвизовом режиме более чем по 110 странам, получить право открыть свое дело в США и Великобритании и многое другое.</p>\r\n<p>Процесс оформления проходит достаточно быстро и просто, а это значит, что, приобретая квартиру в нашем жилищном комплексе, вы инвестируете в свое будущее.</p>','<iframe src=\"https://yandex.ru/map-widget/v1/?um=constructor%3Afc64a3d223ff913723c16022e4266225030f99a540ffe10915e3499fe62a343b&source=constructor&scroll=false\" width=\"100%\" height=\"500\" frameborder=\"0\"></iframe>','ДОСТОПРИЧАТЕЛЬНОСТИ АНТАЛИИ','[{\"id\": \"0\", \"photo\": \"uploads/landing_274827534.png\", \"title\": \"Десятки исторических памятников культуры\", \"content\": \"<p>Анталья &ndash; курортный город, который славится своей Старой гаванью, где швартуются яхты, и пляжами, окруженными огромными отелями.</p>\"}, {\"id\": \"1\", \"photo\": \"uploads/landing_350227984.png\", \"title\": \"Десятки исторических памятников культуры\", \"content\": \"<p>В Анталье расположены десятки исторических памятников культуры, которые непременно стоит увидеть! На протяжении всей своей истории Анталья становилась домом для десятка цивилизаций, сохранила следы этих цивилизаций и сегодня выставляет их для своих посетителей</p>\"}]',NULL,NULL,30,NULL),(11,'alanya','https://alanya.one-team.pro/',1,'2023-11-16 07:22:04','2023-11-16 08:57:25','8 800 700 55 55','Аланья','<div class=\"flex flex-grow flex-col max-w-full gap-3 gizmo:gap-0\">\r\n<div class=\"min-h-[20px] text-message peer flex flex-col items-start gap-3 whitespace-pre-wrap break-words peer-[.text-message]:mt-5 overflow-x-auto\" data-message-author-role=\"assistant\" data-message-id=\"11889925-ff3c-4431-b195-5f5c434efe01\">\r\n<div class=\"markdown prose w-full break-words dark:prose-invert light\">\r\n<p>Аланья &mdash; жемчужина Средиземноморья, где встречаются золотистые пляжи, древняя крепость и культурные фестивали. Отдыхайте на побережье, исследуйте старый город и наслаждайтесь активным отдыхом в горах. Местная кухня удивит вас разнообразием вкусов. От природы до истории, Аланья &mdash; идеальное сочетание для незабываемого отпуска.</p>\r\n</div>\r\n</div>\r\n</div>\r\n<div class=\"flex justify-between empty:hidden gizmo:mt-1 gizmo:justify-start gizmo:gap-3 lg:block gizmo:lg:flex\">\r\n<div class=\"text-gray-400 flex self-end lg:self-center justify-center gizmo:lg:justify-start mt-2 gizmo:mt-0 visible gap-1\">&nbsp;</div>\r\n</div>','uploads/landing_1906444652.jpg','[{\"id\": \"0\", \"title\": \"300\", \"content\": \"Солнечных дней в году\"}, {\"id\": \"1\", \"title\": \"100 км\", \"content\": \"Длина пляжей более\"}, {\"id\": \"2\", \"title\": \"природа\", \"content\": \"Заповедники и горные тропы для активного отдыха и наслаждения красотой зеленых пейзажей\"}, {\"id\": \"3\", \"title\": \"10\", \"content\": \"Комплексов в продаже\"}]','НОВОСТРОЙКИ В  АЛАНЬИ',NULL,NULL,NULL,'[{\"id\": \"0\", \"title\": \"Беспроцентная рассрочка\", \"content\": \"<p>Рассрочка на период строительства</p>\\r\\n<p>Первоначальный платеж 30% от стоимости квартиры</p>\\r\\n<ul class=\\\"list_point\\\">\\r\\n<li>Возможна удалённая сделка</li>\\r\\n<li>Помощь по вариантам оплаты</li>\\r\\n</ul>\\r\\n<p>Вид на жительство можете получить после внесения последнего платежа</p>\"}, {\"id\": \"1\", \"title\": \"Оплата 100%\", \"content\": \"<ul class=\\\"list_point\\\">\\r\\n<li>Возможна удалённая сделка</li>\\r\\n<li>Помощь по вариантам оплаты</li>\\r\\n</ul>\"}]',NULL,'Вид на жительство в Анталии','<p>Покупая квартиру в ЖК &laquo;Perge Collection: sky blue&raquo; вы не только приобретаете жилье в большом курортном городе с отличным климатом, которое можно сдавать в аренду, но и получаете более ценные преимущества, такие, как вид на жительство в Турции или даже гражданство.</p>\r\n<p>ВНЖ имеет ряд несомненных плюсов, вы можете круглогодично жить в стране, открыть свой бизнес, бесплатно пользоваться некоторыми государственными услугами, а также претендовать на турецкое гражданство уже через 5 лет после приобретения недвижимости.</p>\r\n<p>Турецкий паспорт позволит вам пользоваться всеми привилегиями этого государства, путешествовать в безвизовом режиме более чем по 110 странам, получить право открыть свое дело в США и Великобритании и многое другое.</p>\r\n<p>Процесс оформления проходит достаточно быстро и просто, а это значит, что, приобретая квартиру в нашем жилищном комплексе, вы инвестируете в свое будущее.</p>','<iframe src=\"https://yandex.ru/map-widget/v1/?um=constructor%3A736426aba0cddff982f5d47847f9e72620d78d3d72c1bd802cafbc0048180aaa&amp;source=constructor\" width=\"731\" height=\"514\" frameborder=\"0\"></iframe>','ДОСТОПРИЧАТЕЛЬНОСТИ  АЛАНЬИ','[{\"id\": \"0\", \"photo\": \"uploads/landing_328634068.jpg\", \"title\": \"Башня Кызылкуле\", \"content\": \"<p>Башня Кызылкуле в Аланье, Турция &mdash; символ старого города, возвышающийся над Средиземным морем. Построенная в XIII веке, она впечатляет своей архитектурой и историческим наследием. Своим названием \\\"Кызылкуле\\\" (что переводится как \\\"Красная башня\\\") она обязана красно-бурой глине, использованной для ее строительства. Посетители могут подняться на вершину башни и насладиться великолепным видом на город и море, а также узнать интересные факты о прошлом этого впечатляющего сооружения.</p>\"}, {\"id\": \"1\", \"photo\": \"uploads/landing_2024192026.jpg\", \"title\": \"Крепость Аланьи\", \"content\": \"<div class=\\\"flex flex-grow flex-col max-w-full gap-3 gizmo:gap-0\\\">\\r\\n<div class=\\\"min-h-[20px] text-message peer flex flex-col items-start gap-3 whitespace-pre-wrap break-words peer-[.text-message]:mt-5 overflow-x-auto\\\" data-message-author-role=\\\"assistant\\\" data-message-id=\\\"6d83d0bf-ef7d-452d-b509-8b7082c7a2a1\\\">\\r\\n<div class=\\\"markdown prose w-full break-words dark:prose-invert light\\\">\\r\\n<p>Крепость Аланьи &mdash; историческая жемчужина на турецком побережье Средиземного моря. Возвышаясь на скале, эта древняя крепость, основанная в XIII веке, представляет собой величественное сочетание стен, башен и внутренних дворцовых сооружений. С момента своего создания крепость играла ключевую роль в защите региона, а сегодня привлекает туристов своей архитектурной красотой и захватывающими видами на Средиземное море. Посетители могут прогуляться по старинным улочкам, изучить археологические находки и насладиться атмосферой старинного военного великолепия.</p>\\r\\n</div>\\r\\n</div>\\r\\n</div>\"}]',NULL,NULL,33,NULL);
