CREATE TABLE `layouts` (
  `id` bigint unsigned NOT NULL AUTO_INCREMENT,
  `building` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `name` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `type` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `base_price` bigint DEFAULT NULL,
  `price` bigint DEFAULT NULL,
  `price_code` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `total_size` double(8,2) DEFAULT NULL,
  `living_size` double(8,2) DEFAULT NULL,
  `number_rooms` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `floor` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `number_bedrooms` int DEFAULT NULL,
  `number_bathrooms` int DEFAULT NULL,
  `number_balconies` int DEFAULT NULL,
  `complex_id` bigint unsigned DEFAULT NULL,
  `created_at` timestamp NULL DEFAULT NULL,
  `updated_at` timestamp NULL DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `layouts_complex_id_index` (`complex_id`),
  CONSTRAINT `layouts_complex_id_foreign` FOREIGN KEY (`complex_id`) REFERENCES `products` (`id`) ON DELETE CASCADE ON UPDATE CASCADE
