INSERT INTO `product_locale` VALUES (1,7,1,'Description in RussianDescription in RussianDescription in RussianDescription in Russian','Locations in Russian Locations in Russian Locations in Russian Locations in Russian','2023-11-16 20:24:01','2023-11-16 20:24:01'),(2,7,2,'Описание на РусскомОписание на РусскомОписание на РусскомОписание на Русском','Расположения на РусскомРасположения на РусскомРасположения на РусскомРасположения на Русском','2023-11-16 20:24:02','2023-11-16 20:24:02'),(3,7,3,'Rusça AçıklamaRusça AçıklamaRusça AçıklamaRusça Açıklama','Rusya\'daki Mekanlar Rusya\'daki Mekanlar Rusya\'daki Mekanlar Rusça\'daki Mekanlar','2023-11-16 20:24:02','2023-11-16 20:24:02'),(4,7,4,'Beschreibung auf RussischBeschreibung auf RussischBeschreibung auf RussischBeschreibung auf Russisch','Standorte auf Russisch Standorte auf Russisch Standorte auf Russisch Standorte auf Russisch','2023-11-16 20:24:02','2023-11-16 20:24:02'),(5,8,1,'123','123123','2023-11-16 20:24:03','2023-11-16 20:24:03'),(6,8,2,'123','123123','2023-11-16 20:24:03','2023-11-16 20:24:03'),(7,8,3,'123','123123','2023-11-16 20:24:03','2023-11-16 20:24:03'),(8,8,4,'123','123123','2023-11-16 20:24:03','2023-11-16 20:24:03'),(9,15,1,'Outdoor swimming pool, Free shuttle to the sea, Fitness room, Finnish sauna, BBQ area, Children\'s playground, Green area, Open parking, Underground parking, Generator, 24-hour video surveillance, Management company (located on the territory of the complex).','2 km from the center of Alanya, Distance from Antalya International Airport to Avsallar 130 km, From Gazipasa International Airport – 40 km, Distance to the sea is 3 km','2023-11-16 20:24:03','2023-11-16 20:24:03'),(10,15,2,'Открытый бассейн, Бесплатный шаттл до моря, Фитнес-зал, Финская сауна, Зона для барбекю, Детская площадка, Озелененная территория, Открытая парковка, Подземная парковка, Генератор, Круглосуточное видеонаблюдение, Управляющая компания (находится на территории комплекса).','2 км от центра Алании, Расстояние от международного аэропорта Анталии до Авсаллара 130 км, От международного аэропорта Газипаша – 40 км, Расстояние до моря составляет 3 км','2023-11-16 20:24:03','2023-11-16 20:24:03'),(11,15,3,'Açık havuz, Denize ücretsiz servis, Fitness salonu, Fin saunası, Barbekü alanı, Çocuk oyun alanı, Yeşil alan, Açık otopark, Yer altı otoparkı, Jeneratör, 24 saat güvenlik kamerası, Yönetim şirketi (site içerisinde yer almaktadır) .','Alanya merkeze 2 km, Antalya Uluslararası Havalimanı Avsallar\'a 130 km, Gazipasa Uluslararası Havalimanına 40 km, Denize Uzaklık 3 km','2023-11-16 20:24:04','2023-11-16 20:24:04'),(12,15,4,'Außenpool, kostenloser Shuttle zum Meer, Fitnessraum, finnische Sauna, Grillplatz, Kinderspielplatz, Grünfläche, offener Parkplatz, Tiefgarage, Generator, 24-Stunden-Videoüberwachung, Verwaltungsgesellschaft (auf dem Gelände des Komplexes) .','2 km vom Zentrum von Alanya, Entfernung vom internationalen Flughafen Antalya nach Avsallar 130 km, vom internationalen Flughafen Gazipasa – 40 km, Entfernung zum Meer beträgt 3 km','2023-11-16 20:24:04','2023-11-16 20:24:04'),(13,16,1,'Special design, luxury, state-of-the-art technology, first-class\r\nprivate villas with private pools in a gated complex\r\n\r\nPeculiarities\r\n\r\n- 7/24 security and surveillance cameras. Entrance to the territory\r\npassword and photocell Door Dorma or Assa Abloy.\r\n- The garden walls have an architectural design\r\nbalustrade made of suspended concrete.\r\n- Lightning rod\r\n- Arken, Aksa or Genpower full power generator\r\nwith diesel cab.\r\n- Possibility of intercom between villas and\r\nsecurity\r\n- Private outdoor parking for each villa\r\n- Water purification system\r\n- Entrance door to the site - Sur or Binadoor. Lock brand Yale, Kale\r\nor an Ito brand lock.\r\n- All kitchens, bathrooms, dressing rooms, shoe cabinets\r\nand dressing rooms are varnished on MDF laminate.\r\n- Specially designed landscape\r\n- Drilling and watering system','Antalya, Dosemealti District, Mahalla Altinkole','2023-11-16 20:24:04','2023-11-16 20:24:04'),(14,16,2,'Особый дизайн, роскошь, самые современные технологии, первоклассные\r\nчастные виллы с собственными бассейнами в охраняемом комплексе\r\n\r\nОсобенности\r\n\r\n- Охрана 7/24 и камеры наблюдения. Вход на территорию\r\nпароль и фотоэлемент Дверь Dorma или Assa Abloy.\r\n- Стены сада имеют архитектурный дизайн\r\nбалюстрада из навесного бетона.\r\n- Молниеотвод\r\n- Генератор полной мощности Arken, Aksa или Genpower\r\nс дизельной кабиной.\r\n- Возможность переговорного устройства между виллами и\r\nохраной\r\n- Частная открытая парковка для каждой виллы\r\n- Система очистки воды\r\n- Входная дверь на участок - Sur или Binadoor. Замок марки Yale, Kale\r\nили замок марки Ito.\r\n- Все кухни, ванные комнаты, гардеробные, тумбы для обуви\r\nи гардеробные покрыты лаком на МДФ-ламе.\r\n- Специально разработанный ландшафт\r\n- Система бурения и полива','Анталия, Район Дёшемеалты, Махаля Алтынкале','2023-11-16 20:24:04','2023-11-16 20:24:04'),(15,16,3,'Özel tasarım, lüks, son teknoloji, birinci sınıf\r\ngüvenlikli sitede özel havuzlu özel villalar\r\n\r\nÖzellikler\r\n\r\n- 7/24 güvenlik ve gözetleme kameraları. Bölgeye giriş\r\nşifreli ve fotoselli Kapı Dorma veya Assa Abloy.\r\n- Bahçe duvarları mimari tasarıma sahiptir\r\nasma betondan yapılmış korkuluk.\r\n- Paratoner\r\n- Arken, Aksa veya Genpower tam güç jeneratör\r\ndizel kabinli.\r\n- Villalar arası interkom imkanı\r\ngüvenlik\r\n- Her villaya özel açık otopark\r\n- Su arıtma sistemi\r\n- Siteye giriş kapısı - Sur veya Binadoor. Kilit markası Yale, Kale\r\nveya bir Ito marka kilit.\r\n- Tüm mutfaklar, banyolar, giyinme odaları, ayakkabı dolapları\r\nsoyunma odaları MDF laminant üzeri verniklenmiştir.\r\n- Özel tasarlanmış peyzaj\r\n- Sondaj ve sulama sistemi','Antalya, Döşemealtı Mahallesi, Mahalla Altınkole','2023-11-16 20:24:05','2023-11-16 20:24:05'),(16,16,4,'Besonderes Design, Luxus, modernste Technologie, erstklassig\r\nPrivate Villen mit privaten Pools in einer geschlossenen Anlage\r\n\r\nBesonderheiten\r\n\r\n- Sicherheits- und Überwachungskameras rund um die Uhr. Eingang zum Territorium\r\nPasswort und Fotozelle Tür Dorma oder Assa Abloy.\r\n- Die Gartenmauern sind architektonisch gestaltet\r\nBalustrade aus abgehängtem Beton.\r\n- Blitzableiter\r\n- Vollleistungsgenerator Arken, Aksa oder Genpower\r\nmit Dieselkabine.\r\n- Möglichkeit der Gegensprechanlage zwischen Villen und\r\nSicherheit\r\n- Privater Außenparkplatz für jede Villa\r\n- Wasseraufbereitungssystem\r\n- Eingangstür zum Gelände – Sur oder Binadoor. Schlossmarke Yale, Kale\r\noder ein Ito-Markenschloss.\r\n- Alle Küchen, Badezimmer, Umkleidekabinen, Schuhschränke\r\nund Umkleidekabinen sind auf MDF-Laminat lackiert.\r\n- Speziell gestaltete Landschaft\r\n- Bohr- und Bewässerungssystem','Antalya, Bezirk Dosemealti, Mahalla Altinkole','2023-11-16 20:24:05','2023-11-16 20:24:05'),(17,17,1,'Features of the project:\r\n5 built-in sets (hob, oven, hood, microwave, oven, microwave, dishwasher), \"warm floor\" system and VRF air conditioning system,\r\nHeat and sound insulation,\r\nClosed parking,\r\nOutdoor pool, Children\'s pool and water park,\r\nSpa, Hammam, Sauna, Fitness,\r\nOutdoor play area,\r\nGenerator,\r\nSecurity and video surveillance system,\r\nVideo intercom system','Airport 7 km\r\nLara Beach: 5 km\r\nShopping center: 7 km','2023-11-16 20:24:05','2023-11-16 20:24:05'),(18,17,2,'Особенности проекта:\r\n5 встроенных комплектов (варочная панель, духовой шкаф, вытяжка, микроволновая печь, духовка, микроволновая печь, посудомоечная машина), Система \"теплый пол\" и система кондиционирования VRF,\r\nТепло- и звукоизоляция,\r\nЗакрытая парковка,\r\nОткрытый бассейн, Детский бассейн и аквапарк,\r\nСпа, Хаммам, Сауна, Фитнес,\r\nОткрытая игровая площадка,\r\nГенератор,\r\nСистема безопасности и видеонаблюдения,\r\nСистема видеодомофонов','Аэропорт 7 км\r\nПляж Лара: 5 км\r\nТорговый центр: 7 км','2023-11-16 20:24:05','2023-11-16 20