oor to the rooftop floor.\r\nElevator, underfloor heating on all floors and rooms and central air conditioning.\r\nIn the open area of ​​our villa project there is a large landscaped hobby garden with an outdoor infinity pool\r\nSwimming pool area 100 sq. m with a sun lounger, a children\'s pool and a fire pit. The site also has\r\nautomatic gates with easy access from the road lift, closed parking for 4 cars, generator area, outdoor parking for 3 cars\r\nThere is parking and lightweight retaining walls with security cameras.','2 km to the sea','2023-11-16 20:24:23','2023-11-16 20:24:23'),(98,37,2,'Каждая спальня имеет балкон с видом на море и бассейн с южной стороны. Гостиная с камином, 1 спальня с ванной комнатой, 1 общая ванная комната, тамбур и шахта лифта \r\nимеются. Главный фасад всех наших номеров обращен в южном направлении, но доминирует фасад, обращенный к бассейну и морю. \r\nПроект нашей виллы имеет 3 остановки, которые могут быть использованы на всех этажах, начиная с первого и заканчивая этажом на крыше. \r\nЛифт, полы с подогревом на всех этажах и в комнатах и центральная система кондиционирования. \r\nНа открытой территории нашего проекта виллы большой ландшафтный сад хобби сад открытый бесконечный бассейн \r\nБассейн площадью 100 кв. м с шезлонгом, детским бассейном и костровой площадкой. На участке также имеется \r\nавтоматические ворота с удобным доступом с дорожного подъема, закрытая автостоянка на 4 машины, площадка для генератора, открытая автостоянка на 3 машины \r\nИмеется парковка и легкие подпорные стенки с камерами наблюдения.','До моря 2км','2023-11-16 20:24:23','2023-11-16 20:24:23'),(99,37,3,'Her yatak odasında güney tarafında deniz ve havuz manzaralı bir balkon bulunmaktadır. Şömineli oturma odası, banyolu 1 yatak odası, 1 ortak banyo, giriş holü ve asansör boşluğu\r\nmevcut. Tüm odalarımızın ana cephesi güneye bakmaktadır ancak havuz ve denize bakan cephesi hakimdir.\r\nVilla projemizde zemin kattan çatı katına kadar tüm katlarda kullanılabilen 3 durak bulunmaktadır.\r\nAsansör, tüm katlarda ve odalarda yerden ısıtma ve merkezi klima.\r\nVilla projemizin açık alanında açık sonsuzluk havuzlu geniş peyzajlı hobi bahçesi bulunmaktadır.\r\nYüzme havuzu alanı 100 m2 şezlong, çocuk havuzu ve ateş çukuru bulunan m. Sitede ayrıca\r\nYol asansöründen kolay erişim sağlayan otomatik kapılar, 4 araçlık kapalı otopark, jeneratör alanı, 3 araçlık açık otopark\r\nOtopark ve güvenlik kameralı hafif istinat duvarları bulunmaktadır.','Denize 2 kilometre','2023-11-16 20:24:23','2023-11-16 20:24:23'),(100,37,4,'Jedes Schlafzimmer verfügt über einen Balkon mit Blick auf das Meer und den Pool auf der Südseite. Wohnzimmer mit Kamin, 1 Schlafzimmer mit Bad, 1 Gemeinschaftsbad, Vorraum und Aufzugsschacht\r\nverfügbar. Die Hauptfassade aller unserer Zimmer ist nach Süden ausgerichtet, jedoch dominiert die Fassade zum Pool und zum Meer.\r\nUnser Villenprojekt verfügt über 3 Haltestellen, die auf allen Etagen, vom Erdgeschoss bis zum Dachgeschoss, genutzt werden können.\r\nAufzug, Fußbodenheizung in allen Etagen und Räumen sowie zentrale Klimaanlage.\r\nIm offenen Bereich unseres Villenprojekts befindet sich ein großer angelegter Hobbygarten mit einem Infinity-Außenpool\r\nSchwimmbadbereich 100 qm. m mit einer Sonnenliege, einem Kinderbecken und einer Feuerstelle. Die Seite hat auch\r\nautomatische Tore mit einfachem Zugang über den Straßenlift, geschlossener Parkplatz für 4 Autos, Generatorbereich, Außenparkplatz für 3 Autos\r\nEs gibt Parkplätze und leichte Stützmauern mit Überwachungskameras.','2 km zum Meer','2023-11-16 20:24:24','2023-11-16 20:24:24'),(101,38,1,'The complex has many open spaces and landscaped paths,\r\nOpen pool,\r\nIndoor pool,\r\nChildren\'s pool, Water park,\r\nTurkish hamam (bath),\r\nSauna,\r\nSteam bath,\r\nRest zone,\r\nGenerator,\r\nLobby,\r\nPlayground,\r\nReserved parking for 20-25 cars','In the immediate vicinity of the complex there are retail stores, restaurants and cafes, numerous Turkish shops, and other socially significant objects that are necessary for a comfortable life. Thanks to this wonderful location, residents of the complex will feel comfortable. 150 meters from the sea.','2023-11-16 20:24:24','2023-11-16 20:24:24'),(102,38,2,'В комплексе много открытых пространств и озелененных дорожек,\r\nОткрытый бассейн,\r\nКрытый бассейн,\r\nДетский бассейн, Аквапарк,\r\nТурецкий хамам (баня),\r\nСауна,\r\nПаровая баня,\r\nЗона отдыха,\r\nГенератор,\r\nЛобби,\r\nДетская площадка,\r\nЗарезервированная парковка на 20-25 авто','В непосредственной близости от комплекса расположены магазины розничной торговли, рестораны и кафе, многочисленные турецкие лавки, и другие социально значимые объекты, которые необходимы для удобной жизни. Благодаря этой прекрасной локации жители комплекса будут чувствовать себя комфортно. 150 метров от моря.','2023-11-16 20:24:24','2023-11-16 20:24:24'),(103,38,3,'Komplekste birçok açık alan ve peyzajlı yol bulunmaktadır.\r\nAçık havuz,\r\nKapalı havuz,\r\nÇocuk havuzu, Su parkı,\r\nTürk hamamı (hamam),\r\nSauna,\r\nBuhar banyosu,\r\nDinlenme bölgesi,\r\nJeneratör,\r\nLobi,\r\nOyun alanı,\r\n20-25 araçlık ayrılmış otopark','Kompleksin hemen yakınında perakende mağazalar, restoranlar ve kafeler, çok sayıda Türk mağazası ve konforlu bir yaşam için gerekli olan diğer sosyal açıdan önemli nesneler bulunmaktadır. Bu harika konum sayesinde kompleksin sakinleri kendilerini rahat hissedecek. Denize 150 metre.','2023-11-16 20:24:24','2023-11-16 20:24:24'),(104,38,4,'Der Komplex verfügt über viele Freiflächen und angelegte Wege,\r\nOffener Pool,\r\nInnenpool,\r\nKinderbecken, Wasserpark,\r\nTürkisches Hamam (Bad),\r\nSauna,\r\nDampfbad,\r\nRuhezone,\r\nGenerator,\r\nEmpfangshalle,\r\nKinderspielplatz,\r\nReservierter Parkplatz für 20-25 Autos','In unmittelbarer Nähe des Komplexes befinden sich Einzelhandelsgeschäfte, Restaurants und Cafés, zahlreiche türkische Geschäfte und andere gesellschaftlich bedeutsame Objekte, die für ein angeneh