-16 20:24:27','2023-11-16 20:24:27'),(114,41,2,'Квартира 1+1 на 1 этаже  блока E, с мебелью и техникой,  В тапу 850000 лир Хамам, Сауна, Фитнес, Охрана 24/7,  С видом во двор, Новый дом в комплексе Ekpa 1207   Antalya, названный в честь года освобождения Анталии, построен на участке площадью 30 гектаров с 1163 квартирами и 46 коммерческими магазинами, что делает его крупнейшим жилым проектом Антальи. В то время как зеленая территория площадью 24 712 м² предлагает жизнь, украшенную великолепными красотами природы, она дает возможность ощутить веселье города и покой природы одновременно с социальными удобствами внутри.','Проект 1207 Antalya расположен в районе Кепез, в самом центре города, всего в 9 км от международного аэропорта Антальи, в 5 км от центра города и в 8 км от пляжа, с отличными социальными удобствами для всех, предлагая легкий доступ к повсюду.','2023-11-16 20:24:27','2023-11-16 20:24:27'),(115,41,3,'E blok 1.kat, mobilya ve beyaz eşyalı 1+1 daire, Tapa 850.000 lira Hamam, Sauna, Fitness, 7/24 Güvenlik, Avluya bakan, Ekpa 1207 Antalya kompleksinde yeni ev, adını Antalya\'nın kurulduğu yıldan alıyor 30 hektarlık arazi üzerinde 1.163 daire ve 46 ticari mağazanın yer aldığı Kurtuluş, Antalya\'nın en büyük konut projesi olma özelliği taşıyor. 24.712 m²\'lik yeşil alan, doğanın muhteşem güzellikleriyle bezenmiş bir yaşam sunarken, içerisinde yer alan sosyal olanaklarla birlikte şehrin eğlencesini ve doğanın huzurunu aynı anda deneyimleme fırsatı sunuyor.','Proje 1207 Antalya, şehrin göbeğinde Kepez semtinde, Antalya Uluslararası Havalimanı\'na sadece 9 km, şehir merkezine 5 km ve plaja 8 km uzaklıkta, herkes için mükemmel sosyal olanaklara sahip, her yere kolay ulaşım imkanı sunan bir konumda yer almaktadır.','2023-11-16 20:24:27','2023-11-16 20:24:27'),(116,41,4,'Apartment 1+1 im 1. Stock von Block E, mit Möbeln und Geräten, Tapa 850.000 Lira, Hammam, Sauna, Fitness, Sicherheit rund um die Uhr, Blick auf den Innenhof, neues Haus im Ekpa 1207 Antalya-Komplex